import React from "react";

import Navbar from "../components/Navbar";

const Author = () => {
  return (
    <div>
      <Navbar />
      <div className="container" key="cards">
        <div className="row">
          {articles.map((article) => (
            <Card article={article} key={article.id} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Author;
